import React from 'react';
import './DevLogin.css';

const DevLogin = () => {
  return (
    <div className="login-container">
      <h1 className="login-title">Welcome back, Developer!</h1>
      <h2 className="login-subtitle">Let's connect you to a job !</h2>
      <form className="login-form">
        <label htmlFor="email" className="login-label">Email</label>
        <input type="email" id="email" placeholder="Email" className="login-input" required />
        
        <label htmlFor="password" className="login-label">Password</label>
        <input type="password" id="password" placeholder="Password" className="login-input" required />
        
        <div className="button-container">
          <button type="submit" className="login-button">Log In</button>
        </div>
      </form>
    </div>
  );
}

export default DevLogin;
